import React from 'react';
import MinimalistLayout from '../components/MinimalistLayout';

const CoursesPage = () => {
  return (
    <MinimalistLayout title="Courses">
      <section className="page-title">
        <div className="container">
          <h1>Our Courses</h1>
          <p className="lead">Explore our catalog of cutting-edge learning experiences.</p>
        </div>
      </section>

      <section className="courses section">
        <div className="container" data-aos="fade-up">
          <div className="row justify-content-center">
            <div className="col-lg-8 text-center mb-5">
              <h2 className="mb-3">Coming Soon</h2>
              <p>We are crafting an exceptional e-learning library. Stay tuned!</p>
            </div>
          </div>
        </div>
      </section>
    </MinimalistLayout>
  );
};

export default CoursesPage;
